import React, {useState} from 'react';

const DataFetch = (props) => {

    let [dataFetched, toggleData] = useState(false);

    const toggleFetch = (event) => {
        event.preventDefault();
        props.startSelectorHandler(true);
        toggleData(true);
    }

    return (
        <div class="col">
            <div>
                <button type="submit" className="btn btn-primary" onClick={toggleFetch} disabled={dataFetched}>Fetch Database</button>
            </div>
            <h1 hidden={!dataFetched}>Hello</h1>
        </div>
    )
}

export default DataFetch;
